	 ('123000201','20210205','SYSTEM','472',NULL,'a.person@test.org','LO WOOLWICH','123000101','Your Jury Service','The date of your attendance for Jury Service has changed to Monday 15th August at 9:00AM at Royal Courts of Justice Court. The days you are not required at court still form part of your jury service and will not be added on at the end. If you have any questions, please contact the jury office on 020  79476375.',3,'SN'),
	 ('123000202','20210205','SYSTEM','626','07654100002',NULL,'LO ROYAL COURTS OF JUSTICE','123000102','Your Jury Service','The time of your attendance for Jury Service has changed to 9:00AM. The date remains the same. If you have any questions, please contact the jury office on 020  79476375.',4,'SN'),
	 ('123000203','20210205','SYSTEM','472',NULL,'b.person@test.org','LO WOOLWICH','123000103','Your Jury Service','The time of your attendance for Jury Service has changed to 9:00AM. The date remains the same. If you have any questions, please contact the jury office on 020  79476375.',4,'SN'),
	 ('123000204','20210205','SYSTEM','626','07654100003',NULL,'LO ROYAL COURTS OF JUSTICE','123000104','Your Jury Service','Due to local adverse weather conditions, you are not required to attend the court until further notice. Please await further information. If you have any questions, please contact the jury office on 020  79476375.',12,'SN'),
	 ('123000205','20210205','SYSTEM','472',NULL,'c.person@test.org','LO WOOLWICH','123000105','Your Jury Service','Due to local adverse weather conditions, you are not required to attend the court until further notice. Please await further information. If you have any questions, please contact the jury office on 020  79476375.',12,'SN'),
	 ('123000206','20210205','SYSTEM','626','07654100004',NULL,'LO ROYAL COURTS OF JUSTICE','123000106','Your Jury Service','Your jury panel is likely to go into deliberation tomorrow. Please bring a packed lunch to court as you will not be able to leave the deliberation room to get refreshments. Please do not bring metal cutlery or glass. If you have any questions, please contact the jury office on 020  79476375.',14,'SN'),
	 ('123000207','20210205','SYSTEM','472',NULL,'d.person@test.org','LO WOOLWICH','123000107','Your Jury Service','Your jury panel is likely to go into deliberation tomorrow. Please bring a packed lunch to court as you will not be able to leave the deliberation room to get refreshments. Please do not bring metal cutlery or glass. If you have any questions, please contact the jury office on 020  79476375.',14,'SN'),
	 ('123000209','20210205','SYSTEM','472',NULL,'e.person@test.org','LO WOOLWICH','123000109','Your Jury Service','You are due for Jury Service on Monday 15th August, but please do not attend the court until contacted by the Jury Team. Please attend work if you are able, you will receive sufficient notice when required to attend. If you have any questions, please contact the jury office on 020  79476375.',10,'SN'),
	 ('123000210','20210205','SYSTEM','626','07654100006',NULL,'LO ROYAL COURTS OF JUSTICE','123000110','Your Jury Service','You have been excused from attending jury service on this occasion and are no longer required to attend court. If you have any questions, please contact the jury office on 020  79476375.',15,'SN'),
	 ('123000212','20210205','SYSTEM','626','07654100007',NULL,'LO ROYAL COURTS OF JUSTICE','123000112','Your Jury Service','You failed to attend for Jury Service at Royal Courts of Justice Court on Monday 15th August. Please contact the jury office on 020  79476375.',2,'SN'),
	 ('123000213','20210205','SYSTEM','472',NULL,'g.person@test.org','LO WOOLWICH','123000113','Your Jury Service','You failed to attend for Jury Service at Royal Courts of Justice Court on Monday 15th August. Please contact the jury office on 020  79476375.',2,'SN'),
	 ('123000214','20210205','SYSTEM','626','07654100007',NULL,'LO ROYAL COURTS OF JUSTICE','123000114','Your Jury Service','You are not required to attend court any further and are formally discharged from jury service. If you have any questions, please contact the jury office on 020  79476375.',5,'SN'),
	 ('123000215','20210205','SYSTEM','472',NULL,'g.person@test.org','LO WOOLWICH','123000115','Your Jury Service','You are not required to attend court any further and are formally discharged from jury service. If you have any questions, please contact the jury office on 020  79476375.',5,'SN'),
	 ('123000216','20210205','SYSTEM','626','07654100007',NULL,'LO ROYAL COURTS OF JUSTICE','123000116','Your Jury Service','You are next required to attend for Jury Service on Monday 15th August at 9:00AM at Royal Courts of Justice Court. If you have any questions, please contact the jury office on 020  79476375.',7,'SN'),
	 ('123000217','20210205','SYSTEM','472',NULL,'g.person@test.org','LO WOOLWICH','123000117','Your Jury Service','You are next required to attend for Jury Service on Monday 15th August at 9:00AM at Royal Courts of Justice Court. If you have any questions, please contact the jury office on 020  79476375.',7,'SN'),
	 ('123000218','20210205','SYSTEM','626','07654100007',NULL,'LO ROYAL COURTS OF JUSTICE','123000118','Your Jury Service','You are not required to attend for Jury Service on Monday 15th August. We will be in touch by text/email with regards to your next attendance. If you have any questions, please contact the jury office on 020  79476375.',8,'SN'),
	 ('123000219','20210205','SYSTEM','472',NULL,'g.person@test.org','LO WOOLWICH','123000119','Your Jury Service','You are not required to attend for Jury Service on Monday 15th August. We will be in touch by text/email with regards to your next attendance. If you have any questions, please contact the jury office on 020  79476375.',8,'SN'),
	 ('123000220','20210205','SYSTEM','626','07654100007',NULL,'LO ROYAL COURTS OF JUSTICE','123000120','Your Jury Service','Please contact Royal Courts of Justice Jury Office on 020  79476375 with regard to your jury service.',9,'SN'),
	 ('123000221','20210205','SYSTEM','626',NULL,'g.person@test.org','LO WOOLWICH','123000100','Your Jury Service','Please contact Royal Courts of Justice Jury Office on 020  79476375 with regard to your jury service.',9,'SN'),
	 ('123000222','20210205','SYSTEM','472',NULL,'a.person@test.org','LO WOOLWICH','123000101','Your Jury Service','Reminder: Please attend for your Jury Service at Royal Courts of Justice Court on Monday 15th August at 9:00AM. If you have any questions, please contact the jury office on 020  79476375.',1,'SN'),
	 ('123000224','20210205','SYSTEM','472',NULL,'a.person@test.org','LO WOOLWICH','123000101','Your Jury Service','You have been selected to form a panel from which a jury will be chosen. Please attend Royal Courts of Justice Court on Monday 15th August at 9:00AM. If you have any questions, please contact the jury office on 020  79476375.',11,'SN'),
	 ('123000229','20210205','SYSTEM','626','07654123456',NULL,'LO ROYAL COURTS OF JUSTICE','123000100','Your Jury Service','You are no longer required to attend court and are formally discharged from jury service. If you have any questions, please contact the jury office on 020  79476375.',6,'SN'),
	 ('123000230','20210205','SYSTEM','472',NULL,'a.person@test.org','LO WOOLWICH','123000101','Your Jury Service','You are no longer required to attend court and are formally discharged from jury service. If you have any questions, please contact the jury office on 020  79476375.',6,'SN'),
	 ('123000226','20210205','SYSTEM','472','07654123456',NULL,'LO WOOLWICH','123000101','Your Jury Service','The defendant in the trial in which you were a juror is being sentenced on Wednesday 24th August .
