INSERT INTO juror_mod.t_message_template (id,"scope",title,subject,"text",display_order) VALUES
	 (25,'Court','Welsh On call','Eich Gwasanaeth Rheithgor','Nid oes angen ichi fynychu''r Llys ar gyfer eich Gwasanaeth Rheithgor ar <attend_date>. Byddwn yn cysylltu â chi drwy neges testun/e-bost ynghylch pryd fydd angen i chi fynychu''r Llys eto. Os oes gennych unrhyw gwestiynau, cysylltwch â''r swyddfa rheithgor drwy ffonio <court_phone>.',25),
	 (26,'Court','Welsh Please contact','Eich Gwasanaeth Rheithgor','Cysylltwch â Swyddfa Rheithgor<welsh_courtname> drwy ffonio <court_phone>  ynghylch eich gwasanaeth rheithgor.',26),
	 (1,'Court','Reminder to attend','Your Jury Service','Reminder: Please attend for your Jury Service at <court_name> Court on <attend_date> at <attend_time>. If you have any questions, please contact the jury office on <court_phone>.',1),
	 (2,'Court','Failed to attend','Your Jury Service','You failed to attend for Jury Service at <court_name> Court on <attend_date>. Please contact the jury office on <court_phone>.',2),
	 (3,'Court','Attend date & time changed','Your Jury Service','The date of your attendance for Jury Service has changed to <attend_date> at <attend_time> at <court_name> Court. The days you are not required at court still form part of your jury service and will not be added on at the end. If you have any questions, please contact the jury office on <court_phone>.',3),
	 (4,'Court','Attend time changed','Your Jury Service','The time of your attendance for Jury Service has changed to <attend_time>. The date remains the same. If you have any questions, please contact the jury office on <court_phone>.',4),
	 (5,'Court','Complete (attended)','Your Jury Service','You are not required to attend court any further and are formally discharged from jury service. If you have any questions, please contact the jury office on <court_phone>.',5),
	 (6,'Court','Complete (not needed)','Your Jury Service','You are no longer required to attend court and are formally discharged from jury service. If you have any questions, please contact the jury office on <court_phone>.',6),
	 (7,'Court','Next date','Your Jury Service','You are next required to attend for Jury Service on <attend_date> at <attend_time> at <court_name> Court. If you have any questions, please contact the jury office on <court_phone>.',7),
	 (8,'Court','On call','Your Jury Service','You are not required to attend for Jury Service on <attend_date>. We will be in touch by text/email with regards to your next attendance. If you have any questions, please contact the jury office on <court_phone>.',8),
	 (9,'Court','Please contact','Your Jury Service','Please contact <court_name> Jury Office on <court_phone> with regard to your jury service.',9),
	 (10,'Court','Delayed start','Your Jury Service','You are due for Jury Service on <attend_date>, but please do not attend the court until contacted by the Jury Team. Please attend work if you are able, you will receive sufficient notice when required to attend. If you have any questions, please contact the jury office on <court_phone>.',10),
	 (11,'Court','Selection','Your Jury Service','You have been selected to form a panel from which a jury will be chosen. Please attend <court_name> Court on <attend_date> at <attend_time>. If you have any questions, please contact the jury office on <court_phone>.',11),
	 (12,'Court','Bad weather','Your Jury Service','Due to local adverse weather conditions, you are not required to attend the court until further notice. Please await further information. If you have any questions, please contact the jury office on <court_phone>.',12),
	 (13,'Court','Check Junk/Spam (TXT only)','Your Jury Service','If you''ve provided us with an email address, we''ll use this to keep in touch. Please check your inbox regularly including your junk and spam mailbox.',13),
	 (14,'Court','Bring lunch','Your Jury Service','Your jury panel is likely to go into deliberation tomorrow. Please bring a packed lunch to court as you will not be able to leave the deliberation room to get refreshments. Please do not bring metal cutlery or glass. If you have any questions, please contact the jury office on <court_phone>.',14),
	 (15,'Court','Excused','Your Jury Service','You have been excused from attending jury service on this occasion and are no longer required to attend court. If you have any questions, please contact the jury office on <court_phone>.',15),
	 (16,'Court','Sentence invite(email only)','Your Jury Service','The defendant in the trial in which you were a juror is being sentenced on <sentence_date>.
